import { Container } from "react-bootstrap";
import head from "./components/head";
const App = () => {
  return (
    <>
      <Header />
      <main className="py-3">
        <Container>
          <h1>Welcome to my react-app</h1>;
        </Container>
      </main>
    </>
  );
};

export default App;
